import React from 'react'
import ThreeScene from '../Components/ThreeJs/ThreeScene'
import TreasureHuntInstructions from '../Components/Instructions/TreasureHuntInstructions';
import Button  from '../Components/Button/Button';

export default function Home() {
  return (
    <div style={{ position: 'relative' }}>
      <Button style={buttonStyle}/>
      <ThreeScene />
      <div style={overlayStyle}>
        <TreasureHuntInstructions />
      </div>
    </div>
  )
}
const buttonStyle = {
    zIndex: '-1'
}

const overlayStyle = {
  position: 'absolute',
  top: '50%',
  left: '50%',
  transform: 'translate(-50%, -50%)',
  zIndex: '1' /* Ensure it's above the Three.js scene */,
  backgroundColor: 'rgba(255, 255, 255, 0.7)', // Example background color with opacity
  padding: '20px',
  borderRadius: '10px',
  textAlign: 'center'
};
